import ClavieFolioImg01 from "../../media/img/Projects/02_Creative Developer/Clavie/ClavieFolio01.png";
import ClavieFolioImg02 from "../../media/img/Projects/02_Creative Developer/Clavie/ClavieFolio02.jpg";
import ClavieThumbnailImg from "../../media/img/Projects/02_Creative Developer/Clavie/clavie_thumbnail.png";

/*       ------- SOSMART -------        */
import SoSmartThumbnailImg from "../../media/img/Projects/02_Creative Developer/sosmart/sosmart_thumbnail.png";
import SoSmartHeaderImg from "../../media/img/Projects/02_Creative Developer/sosmart/header-sosmart.png";
import SoSmartDecoImg from "../../media/img/Projects/02_Creative Developer/sosmart/sosmartdeco.png";
import SoSmartFolio01Img from "../../media/img/Projects/02_Creative Developer/sosmart/sosmart-folio01.png";

/*       ------- PARENTREPRISE -------        */
import ParentrepriseThumbnailImg from "../../media/img/Projects/02_Creative Developer/parentreprise/thumbnail-Parentreprise.png";
import ParentrepriseHeaderlImg from "../../media/img/Projects/02_Creative Developer/parentreprise/header-Parentreprise.png";
import ParentrepriseDecoImg from "../../media/img/Projects/02_Creative Developer/parentreprise/Parentreprise-deco.png";
import ParentrepriseFolio01Img from "../../media/img/Projects/02_Creative Developer/parentreprise/Parentreprise-folio.png";

/*       ------- PARENTREPRISE -------        */
import TeslaThumbnailImg from "../../media/img/Projects/02_Creative Developer/Tesla/thumbnail-Tesla.png";
import TeslaHeaderlImg from "../../media/img/Projects/02_Creative Developer/Tesla/header-Tesla.png";
import TeslaDecoImg from "../../media/img/Projects/02_Creative Developer/Tesla/Tesla-deco.png";


export const ClavieProject = {
    ClavieHeader : ClavieHeaderImg,
    ClavieDecorative : ClavieDecorativeImg,
    ClavieFolio01: ClavieFolioImg01,
    ClavieFolio02: ClavieFolioImg02,
    ClavieThumbnail: ClavieThumbnailImg,
}

export const SoSmartProject = {
    SoSmartThumbnail: SoSmartThumbnailImg,
    SoSmartHeader: SoSmartHeaderImg,
    SoSmartDeco: SoSmartDecoImg,
    SoSmartFolio01: SoSmartFolio01Img,
}

export const ParentrepriseProject = {
    ParentrepriseThumbnail : ParentrepriseThumbnailImg,
    ParentrepriseHeader : ParentrepriseHeaderlImg,
    ParentrepriseDeco : ParentrepriseDecoImg,
    ParentrepriseFolio01 : ParentrepriseFolio01Img,
}
